        &amp; CONDITIONS</span></font></b></p>\t\r\n\t\t\t<p>Access to and use of
        the Planning and Development Online system is conditional upon acceptance
        of the following terms. \r\n\t\t\t   You must accept these terms to access
        and use Planning and Development Online:</p>\t\r\n<p><b><font size=\"5\"><span
        style='font-size:16.0pt'>PRIVACY NOTICE RELATING TO DEVELOPMENT APPLICATIONS</span></font></b></p>\t\r\n\t\t\t<p>Logan
        City Council, by resolution has authorised the disclosure of Integrated Development
        Assessment System information via Planning and Development Online (PD Online),
        located on Council's website.</p>\t\t\t\r\n<p>The disclosure of this information
        is in accordance with the exceptions provided for under Information Privacy
        Principle 11(1)(a) and 11(1)(d) contained in the Information Privacy Act 2009
        and section 723(1)(a) of the Sustainable Planning Act 2009.\r\n</p>\r\n<p>Logan
        City Council will take reasonable steps to ensure that your personal information
        is handled in a way that does not contravene the Information Privacy Act 2009,
        however please be aware that all development application and approval documentation,
        including all submissions made against any development application lodged
        with Logan City Council, may be published on PD Online, located on Council's
        website.\r\n</p>\r\n\t\t\t   \r\n\t\t\t<p><b><font size=\"5\"><span style='font-size:12.0pt'>Purpose</span></font></b></p>\r\n\t\t\t<p>The
        Planning and Development Online system is intended to allow interested individuals
        to have convenient, informal \r\n\t\t\t   access to planning documents and
        the status of development applications.</p>\r\n\t\t\t<p>Planning and Development
        Online is not intended to be used, and must not be used, for formal purposes
        such \r\n\t\t\t   as for the purposes of property transactions or settlements.
        Access to documents and \r\n\t\t\t   information for formal purposes must
        be obtained through Council's formal document search \r\n\t\t\t   procedures,
        not through Planning and Development Online.</p>\r\n\t\t\t<p><b><font size=\"5\"><span
        style='font-size:12.0pt'>Copyright</span></font></b></p>\r\n\t\t\t<p>The information
        and documents available for access through the Planning and Development Online
        system are \r\n\t\t\t   copyright works under the Copyright Act 1968 (Cth).</p>\r\n\t\t\t<p>Documents
        and information are made available through Planning and Development Online
        for informal use by \r\n\t\t\t   individuals. Users are not entitled to, and
        must not, reproduce, publish, communicate \r\n\t\t\t   or adapt the documents
        or information made available using the system.</p>\r\n\t\t\t<p>Without limiting
        the above, commercial use, sale or re-transmission of documents or information
        \r\n\t\t\t   obtained using Planning and Development Online is prohibited.
        Enquiries about commercial use of such documents and \r\n\t\t\t   information
        should be directed to Council's Development Assessment Branch (telephone (07)
        3412 5269). </p>\r\n\t\t\t<p><b><font size=\"5\"><span style='font-size:12.0pt'>No
        liability</span></font></b></p>\r\n\t\t\t<p>The documents and information
        available using Planning and Development Online are intended for informal
        use only. \r\n\t\t\t   Council makes no representation or warranty about their
        accuracy, completeness, suitability or fitness.</p>\r\n\t\t\t<p>The documents
        and information available for access through Planning and Development Online
        should not be relied upon without \r\n\t\t\t   confirmation from another source
        such as Council's Development Assessment Branch (telephone (07) 3412 5269).</p>\r\n\t\t\t<p>Some
        types of documents (for example, plans and drawings) may not be available
        through Planning and Development Online, even \r\n\t\t\t   if they form part
        of a development application which is otherwise available.</p>\r\n\t\t\t<p>Except
        for liability which cannot legally be excluded, Council excludes all liability
        (including liability \r\n\t\t\t   for negligence) arising from use of documents
        or information available through the Planning and Development Online system.
        Liability \r\n\t\t\t   which cannot legally be excluded is hereby limited
        to the maximum extent possible.</p>\r\n\t\t\t<p><b><font size=\"5\"><span
        style='font-size:12.0pt'>Right to grant or refuse access</span></font></b></p>\r\n\t\t\t<p>Access
        to the Planning and Development Online system is at the discretion of Council.
        Council reserves the right to refuse to allow \r\n\t\t\t   access to any part
        of the Planning and Development Online system without prior notice, and without
        the need to give any reason for doing so.</p>\r\n\t\t\t<p><b><font size=\"5\"><span
        style='font-size:12.0pt'>Information privacy</span></font></b></p>\r\n\t\t\t<p>The
        Planning and Development Online system may record some information about each
        access to the system (for example, the lP address of \r\n\t\t\t   the computer
        from which the system is accessed, the date and time of access, and the pages,
        documents or information \r\n\t\t\t   viewed). This information is used for
        statistical and site development purposes.</p>\r\n\t\t\t<p>Except for information
        specifically provided by users, Council does not collect any other personal
        information \r\n\t\t\t   during use of the Planning and Development Online
        system. Any personal information specifically provided will not be disclosed
        to \r\n\t\t\t   third parties except with consent, or where required by law.</p>\r\n\t\t\t<p>Council
        takes steps to maintain the currency and accuracy of the personal information
